import React from "react";
import { BurgerDiv, BurgerListTitle } from "./styles";

function BurgerList() {
  return (
    <BurgerDiv>
      <BurgerListTitle>Movies </BurgerListTitle>
      <BurgerListTitle> TV Shows</BurgerListTitle>
      <BurgerListTitle>People </BurgerListTitle>

      <section>
        <p>Contribution Bible</p>
        <p>Apps</p>
        <p>Discussions</p>
        <p>Leaderbord</p>
        <p>Contribute</p>
        <p>API</p>
        <p>Support</p>
        <p>About</p>
        <h3>Login</h3>
      </section>
    </BurgerDiv>
  );
}

export default BurgerList;
